import React from 'react'
import {Route, Switch, withRouter} from 'react-router'
import registerContainer from './containers/registerContainer'


const Routes = () => {

    return (
        <Switch>
            <Route>
                component = {registerContainer}
                exact
                path="/register"
            </Route>
        </Switch>
    )
}

export default withRouter(Routes)
